nodes.description:
attaches a self node to the self pin of 'this' if the CallCreateNode function has DefaultToSelf in it's metadata
* @param	CompilerContext		the context to expand in - likely passed from ExpandNode
@param	SourceGraph			the graph to expand in - likely passed from ExpandNode
@param	CallCreateNode		the CallFunction node that 'this' is imitating
* @return	true on success.

Helper function for expand node to expand the message to handle the case that a ULevelStreaming may be passed which needs to have its LevelScriptActor pulled out
* @param InCompilerContext			CompilerContext from ExpandNode
@param InSourceGraph				Graph that the node are expanding from
@param InStartingExecPin			Exec pin that connects to the message node, to correctly be mapped into the exec pins of the expanded nodes
@param InMessageSelfPin			The message node's self pin, to correctly be mapped i
